import '../assets/styles/introdiv.css';

const IntroDiv = () => {
  return (
    <div className="intro-div">
      <div className="welcome">
        <h1> Welcome to Brewskis!</h1>
        <h5>
          We help make it easy to find local breweries around any city in The
          United States.
        </h5>
      </div>
    </div>
  );
};

export default IntroDiv;
